import styled from "styled-components";

const DashboardStyled = styled.section`
  .div-form {
    background-color: #fff;
    border-radius: 5px;
    border: #c5c7cd solid 1px;
    height: auto;
    width: 97vw;
    margin-top: 8px;
    margin-left: -10px;
    margin-bottom: 8px;
    display: flex;
    justify-content: center;
  }

  .accordion-button,
  .accordion-body {
    padding-top: 0.5rem !important;
    padding-bottom: 0.5rem !important;
    background-color: transparent !important;
    color: #051026 !important;
    border-bottom: 1px solid rgba(60, 99, 146, 0.6) !important;
  }

  .accordion-button:not(.collapsed) {
    color: #dff7f7 !important;
    background-color: #3c6392 !important;
    border-bottom: none !important;
  }

  .accordion-button:not(.collapsed) > .dataRecado {
    display: block;
  }

  .accordion-button:not(.collapsed) > .descricaoRecado {
    display: none;
  }

  .accordion-button:focus {
    box-shadow: none !important;
  }

  .main-2 {
    width: 97vw;
    height: 72vh;
    overflow-x: hidden;
    overflow-y: auto;
    background: rgba(223, 247, 247, 0.9);
    border-radius: 1rem;
    box-shadow: 5px 20px 50px #000;
  }
`;

export default DashboardStyled;
